const typography = {
    small: '14px',
    default: '16px'
}

const darkTheme = {
    typography,
    primary: '#1E1E1E',
    secondary: '#131313',
    tertiary: '#0F0F0F',
    positive: '#FFFFFF',
    specific: '#AAAAAA',
    attention: '#5AD54F',
    accent: '#4BB043'
}

const lightTheme = {
    typography
}

export {
    darkTheme,
    lightTheme
}
